import './Contactus.css'

export default function Contactus() {
    return (
        <nav className = "dropdown">
            <div className="contactus">
                <ul className="link">
                    <a href = "./Disclaimer"><div className="disclaimer">Disclaimer</div></a>
                    <a href = "./Developer"><div className="developer">Developer?</div></a>
                    <a href = "./Faq"><div className="faq">Customer Service</div></a>
                </ul>
            </div>
        </nav>
    );
}
